INSERT INTO `sm_wechat_news_article` VALUES (4,'赵丽颖','/public/upload/wechat/2019/03-05/51512681e45ff0e8f330afcc14d02b62.jpg',1,'','赵丽颖，1987年10月16日出生于河北省廊坊市，中国内地影视女演员。\n\n2006年，因获得雅虎搜星比赛冯小刚组冠军而进入演艺圈&nbsp;[1]&nbsp;&nbsp;；同年，在冯小刚执导的广告片《跪族篇》中担任女主角&nbsp;[2]&','&lt;p&gt;赵丽颖，1987年10月16日出生于河北省廊坊市，中国内地影视女演员。&lt;/p&gt;\n\n&lt;p&gt;2006年，因获得雅虎搜星比赛&lt;a data-lemmaid=&quot;113653&quot; href=&quot;https://baike.baidu.com/item/%E5%86%AF%E5%B0%8F%E5%88%9A/113653&quot; target=&quot;_blank&quot;&gt;冯小刚&lt;/a&gt;组冠军而进入演艺圈&lt;sup data-ctrmap=&quot;:1,&quot; data-sup=&quot;1&quot;&gt;&amp;nbsp;[1]&lt;/sup&gt;&lt;a name=&quot;ref_[1]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;；同年，在冯小刚执导的广告片《&lt;a data-lemmaid=&quot;18692474&quot; href=&quot;https://baike.baidu.com/item/%E8%B7%AA%E6%97%8F%E7%AF%87/18692474&quot; target=&quot;_blank&quot;&gt;跪族篇&lt;/a&gt;》中担任女主角&lt;sup data-ctrmap=&quot;:2,&quot; data-sup=&quot;2&quot;&gt;&amp;nbsp;[2]&lt;/sup&gt;&lt;a name=&quot;ref_[2]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;。2011年，因在古装剧《&lt;a data-lemmaid=&quot;29392&quot; href=&quot;https://baike.baidu.com/item/%E6%96%B0%E8%BF%98%E7%8F%A0%E6%A0%BC%E6%A0%BC/29392&quot; target=&quot;_blank&quot;&gt;新还珠格格&lt;/a&gt;》中饰演&lt;a data-lemmaid=&quot;7884228&quot; href=&quot;https://baike.baidu.com/item/%E6%99%B4%E5%84%BF/7884228&quot; target=&quot;_blank&quot;&gt;晴儿&lt;/a&gt;一角而被观众认识&lt;sup data-ctrmap=&quot;:3,&quot; data-sup=&quot;3&quot;&gt;&amp;nbsp;[3]&lt;/sup&gt;&lt;a name=&quot;ref_[3]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2013年，凭借古装剧《&lt;a data-lemmaid=&quot;1917292&quot; href=&quot;https://baike.baidu.com/item/%E9%99%86%E8%B4%9E%E4%BC%A0%E5%A5%87/1917292&quot; target=&quot;_blank&quot;&gt;陆贞传奇&lt;/a&gt;》获得更多关注。2014年10月，在第10届金鹰电视艺术节举办的投票活动中被选为&amp;ldquo;&lt;a data-lemmaid=&quot;8053525&quot; href=&quot;https://baike.baidu.com/item/%E9%87%91%E9%B9%B0%E5%A5%B3%E7%A5%9E/8053525&quot; target=&quot;_blank&quot;&gt;金鹰女神&lt;/a&gt;&amp;rdquo;&lt;sup data-ctrmap=&quot;:4,&quot; data-sup=&quot;4&quot;&gt;&amp;nbsp;[4]&lt;/sup&gt;&lt;a name=&quot;ref_[4]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;；12月，凭借都市爱情剧《&lt;a data-lemmaid=&quot;14147525&quot; href=&quot;https://baike.baidu.com/item/%E6%9D%89%E6%9D%89%E6%9D%A5%E4%BA%86/14147525&quot; target=&quot;_blank&quot;&gt;杉杉来了&lt;/a&gt;》获得第5届国剧盛典内地最具人气女演员奖&lt;sup data-ctrmap=&quot;:5,&quot; data-sup=&quot;5&quot;&gt;&amp;nbsp;[5]&lt;/sup&gt;&lt;a name=&quot;ref_[5]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;；同年，成立海润传媒赵丽颖工作室。&lt;/p&gt;\n\n&lt;p&gt;2015年，主演的仙侠剧《&lt;a data-lemmaid=&quot;12813082&quot; href=&quot;https://baike.baidu.com/item/%E8%8A%B1%E5%8D%83%E9%AA%A8/12813082&quot; target=&quot;_blank&quot;&gt;花千骨&lt;/a&gt;》打破中国内地周播剧收视纪录&lt;sup data-ctrmap=&quot;:6,&quot; data-sup=&quot;6&quot;&gt;&amp;nbsp;[6]&lt;/sup&gt;&lt;a name=&quot;ref_[6]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;，而其个人则凭借该剧先后获得第6届&lt;a data-lemmaid=&quot;5256223&quot; href=&quot;https://baike.baidu.com/item/%E6%BE%B3%E9%97%A8%E5%9B%BD%E9%99%85%E7%94%B5%E8%A7%86%E8%8A%82/5256223&quot; target=&quot;_blank&quot;&gt;澳门国际电视节&lt;/a&gt;金莲花最佳女主角奖、第6届&lt;a data-lemmaid=&quot;9003871&quot; href=&quot;https://baike.baidu.com/item/%E5%9B%BD%E5%89%A7%E7%9B%9B%E5%85%B8/9003871&quot; target=&quot;_blank&quot;&gt;国剧盛典&lt;/a&gt;最具收视号召力演员奖、&lt;a data-lemmaid=&quot;19278612&quot; href=&quot;https://baike.baidu.com/item/%E7%AC%AC22%E5%B1%8A%E4%B8%8A%E6%B5%B7%E7%94%B5%E8%A7%86%E8%8A%82/19278612&quot; target=&quot;_blank&quot;&gt;第22届上海电视节&lt;/a&gt;&lt;a data-lemmaid=&quot;11447&quot; href=&quot;https://baike.baidu.com/item/%E7%99%BD%E7%8E%89%E5%85%B0%E5%A5%96/11447&quot; target=&quot;_blank&quot;&gt;白玉兰奖&lt;/a&gt;最佳女主角奖提名、&lt;a data-lemmaid=&quot;18894162&quot; href=&quot;https://baike.baidu.com/item/%E7%AC%AC28%E5%B1%8A%E4%B8%AD%E5%9B%BD%E7%94%B5%E8%A7%86%E9%87%91%E9%B9%B0%E5%A5%96/18894162&quot; target=&quot;_blank&quot;&gt;第28届中国电视金鹰奖&lt;/a&gt;观众喜爱的女演员奖&lt;sup data-ctrmap=&quot;:7,:8,:9,&quot; data-sup=&quot;7-9&quot;&gt;&amp;nbsp;[7-9]&lt;/sup&gt;&lt;a name=&quot;ref_[7-9]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2017年，凭借电影《&lt;a data-lemmaid=&quot;19919941&quot; href=&quot;https://baike.baidu.com/item/%E4%B9%98%E9%A3%8E%E7%A0%B4%E6%B5%AA/19919941&quot; target=&quot;_blank&quot;&gt;乘风破浪&lt;/a&gt;》获得&lt;a data-lemmaid=&quot;20588393&quot; href=&quot;https://baike.baidu.com/item/%E7%AC%AC24%E5%B1%8A%E5%8C%97%E4%BA%AC%E5%A4%A7%E5%AD%A6%E7%94%9F%E7%94%B5%E5%BD%B1%E8%8A%82/20588393&quot; target=&quot;_blank&quot;&gt;第24届北京大学生电影节&lt;/a&gt;最受大学生欢迎女演员奖&lt;sup data-ctrmap=&quot;:10,&quot; data-sup=&quot;10&quot;&gt;&amp;nbsp;[10]&lt;/sup&gt;&lt;a name=&quot;ref_[10]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;；同年主演的古装剧《&lt;a data-lemmaid=&quot;17156299&quot; href=&quot;https://baike.baidu.com/item/%E6%A5%9A%E4%B9%94%E4%BC%A0/17156299&quot; target=&quot;_blank&quot;&gt;楚乔传&lt;/a&gt;》成为中国内地首部在播期间网络播放量突破400亿次的电视剧&lt;sup data-ctrmap=&quot;:11,&quot; data-sup=&quot;11&quot;&gt;&amp;nbsp;[11]&lt;/sup&gt;&lt;a name=&quot;ref_[11]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2018年，主演的都市剧《&lt;a data-lemmaid=&quot;17545341&quot; href=&quot;https://baike.baidu.com/item/%E4%BD%A0%E5%92%8C%E6%88%91%E7%9A%84%E5%80%BE%E5%9F%8E%E6%97%B6%E5%85%89/17545341&quot; target=&quot;_blank&quot;&gt;你和我的倾城时光&lt;/a&gt;》和古装剧《&lt;a data-lemmaid=&quot;20485668&quot; href=&quot;https://baike.baidu.com/item/%E7%9F%A5%E5%90%A6%E7%9F%A5%E5%90%A6%E5%BA%94%E6%98%AF%E7%BB%BF%E8%82%A5%E7%BA%A2%E7%98%A6/20485668&quot; target=&quot;_blank&quot;&gt;知否知否应是绿肥红瘦&lt;/a&gt;》相继播出&lt;sup data-ctrmap=&quot;:12,:13,&quot; data-sup=&quot;12-13&quot;&gt;&amp;nbsp;[12-13]&lt;/sup&gt;&lt;a name=&quot;ref_[12-13]_568771&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。&lt;/p&gt;\n','https://baike.baidu.com/item/赵丽颖','2019-03-07 03:16:09',NULL),(5,'吴彦祖','/public/upload/wechat/2019/03-05/8c87ca83e262b588d5f32501b9eba882.jpg',1,'sam','吴彦祖（Daniel Wu），1974年9月30日出生于美国旧金山，华语影视男演员、导演、制片人，毕业于美国俄勒冈大学。\n\n1998年出演了个人首部电影作品《美少年之恋》，从而踏入演艺圈；同年，凭借文艺片《玻璃之城》提名第18届香港电影金像','&lt;p&gt;吴彦祖（Daniel Wu），1974年9月30日出生于美国旧金山，华语影视男演员、导演、制片人，毕业于美国俄勒冈大学。&lt;/p&gt;\n\n&lt;p&gt;1998年出演了个人首部电影作品《&lt;a data-lemmaid=&quot;1983005&quot; href=&quot;https://baike.baidu.com/item/%E7%BE%8E%E5%B0%91%E5%B9%B4%E4%B9%8B%E6%81%8B/1983005&quot; target=&quot;_blank&quot;&gt;美少年之恋&lt;/a&gt;》，从而踏入演艺圈；同年，凭借文艺片《&lt;a data-lemmaid=&quot;14167&quot; href=&quot;https://baike.baidu.com/item/%E7%8E%BB%E7%92%83%E4%B9%8B%E5%9F%8E/14167&quot; target=&quot;_blank&quot;&gt;玻璃之城&lt;/a&gt;》提名第18届香港电影金像奖最佳新演员&lt;sup data-ctrmap=&quot;:1,:2,&quot; data-sup=&quot;1-2&quot;&gt;&amp;nbsp;[1-2]&lt;/sup&gt;&lt;a name=&quot;ref_[1-2]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2001年，主演文艺片《&lt;a data-lemmaid=&quot;11015959&quot; href=&quot;https://baike.baidu.com/item/%E6%B8%B8%E5%9B%AD%E6%83%8A%E6%A2%A6/11015959&quot; target=&quot;_blank&quot;&gt;游园惊梦&lt;/a&gt;》&lt;sup data-ctrmap=&quot;:3,&quot; data-sup=&quot;3&quot;&gt;&amp;nbsp;[3]&lt;/sup&gt;&lt;a name=&quot;ref_[3]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2003年，凭借动作片《&lt;a data-lemmaid=&quot;2891290&quot; href=&quot;https://baike.baidu.com/item/%E6%97%BA%E8%A7%92%E9%BB%91%E5%A4%9C/2891290&quot; target=&quot;_blank&quot;&gt;旺角黑夜&lt;/a&gt;》提名第24届香港电影金像奖最佳男主角；同年，首次担任电影监制并主演了惊悚片《&lt;a data-lemmaid=&quot;8591411&quot; href=&quot;https://baike.baidu.com/item/%E5%A6%96%E5%A4%9C%E5%9B%9E%E5%BB%8A/8591411&quot; target=&quot;_blank&quot;&gt;妖夜回廊&lt;/a&gt;》&lt;sup data-ctrmap=&quot;:4,:5,&quot; data-sup=&quot;4-5&quot;&gt;&amp;nbsp;[4-5]&lt;/sup&gt;&lt;a name=&quot;ref_[4-5]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。&lt;/p&gt;\n\n&lt;p&gt;2004年，因出演动作片《&lt;a href=&quot;https://baike.baidu.com/item/%E6%96%B0%E8%AD%A6%E5%AF%9F%E6%95%85%E4%BA%8B&quot; target=&quot;_blank&quot;&gt;新警察故事&lt;/a&gt;》中关祖一角受到广泛关注，并凭借该角色获得&lt;a data-lemmaid=&quot;10483852&quot; href=&quot;https://baike.baidu.com/item/%E7%AC%AC41%E5%B1%8A%E5%8F%B0%E6%B9%BE%E7%94%B5%E5%BD%B1%E9%87%91%E9%A9%AC%E5%A5%96/10483852&quot; target=&quot;_blank&quot;&gt;第41届台湾电影金马奖&lt;/a&gt;最佳男配角&lt;sup data-ctrmap=&quot;:6,:1,&quot; data-sup=&quot;1&quot;&gt;&amp;nbsp;[1]&lt;/sup&gt;&lt;a name=&quot;ref_[1]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&lt;sup data-ctrmap=&quot;:6,:1,&quot; data-sup=&quot;6&quot;&gt;[6]&lt;/sup&gt;&lt;a name=&quot;ref_[6]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2006年，主演并执导了个人电影处女作《&lt;a data-lemmaid=&quot;2513215&quot; href=&quot;https://baike.baidu.com/item/%E5%9B%9B%E5%A4%A7%E5%A4%A9%E7%8E%8B/2513215&quot; target=&quot;_blank&quot;&gt;四大天王&lt;/a&gt;》，凭借该片获得&lt;a href=&quot;https://baike.baidu.com/item/%E7%AC%AC26%E5%B1%8A%E9%A6%99%E6%B8%AF%E7%94%B5%E5%BD%B1%E9%87%91%E5%83%8F%E5%A5%96&quot; target=&quot;_blank&quot;&gt;第26届香港电影金像奖&lt;/a&gt;新晋导演奖；同年，主演宫廷片《&lt;a data-lemmaid=&quot;11085&quot; href=&quot;https://baike.baidu.com/item/%E5%A4%9C%E5%AE%B4/11085&quot; target=&quot;_blank&quot;&gt;夜宴&lt;/a&gt;》&lt;sup data-ctrmap=&quot;:7,:8,&quot; data-sup=&quot;7-8&quot;&gt;&amp;nbsp;[7-8]&lt;/sup&gt;&lt;a name=&quot;ref_[7-8]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2007年，主演了剧情片《&lt;a data-lemmaid=&quot;625382&quot; href=&quot;https://baike.baidu.com/item/%E9%97%A8%E5%BE%92/625382&quot; target=&quot;_blank&quot;&gt;门徒&lt;/a&gt;》、动作片《&lt;a data-lemmaid=&quot;8634189&quot; href=&quot;https://baike.baidu.com/item/%E5%A4%A9%E5%A0%82%E9%97%A8/8634189&quot; target=&quot;_blank&quot;&gt;天堂门&lt;/a&gt;》&lt;sup data-ctrmap=&quot;:9,&quot; data-sup=&quot;9&quot;&gt;&amp;nbsp;[9]&lt;/sup&gt;&lt;a name=&quot;ref_[9]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2009年开始，主演了《&lt;a data-lemmaid=&quot;188712&quot; href=&quot;https://baike.baidu.com/item/%E7%AA%83%E5%90%AC%E9%A3%8E%E4%BA%91/188712&quot; target=&quot;_blank&quot;&gt;窃听风云&lt;/a&gt;》系列警匪动作片&lt;sup data-ctrmap=&quot;:10,&quot; data-sup=&quot;10&quot;&gt;&amp;nbsp;[10]&lt;/sup&gt;&lt;a name=&quot;ref_[10]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2010年，吴彦祖监制并主演了爱情片《&lt;a data-lemmaid=&quot;5253174&quot; href=&quot;https://baike.baidu.com/item/%E5%A6%82%E6%A2%A6/5253174&quot; target=&quot;_blank&quot;&gt;如梦&lt;/a&gt;》，并凭借该片提名&lt;a data-lemmaid=&quot;4315609&quot; href=&quot;https://baike.baidu.com/item/%E7%AC%AC46%E5%B1%8A%E5%8F%B0%E6%B9%BE%E7%94%B5%E5%BD%B1%E9%87%91%E9%A9%AC%E5%A5%96/4315609&quot; target=&quot;_blank&quot;&gt;第46届台湾电影金马奖&lt;/a&gt;最佳男主角&lt;sup data-ctrmap=&quot;:11,&quot; data-sup=&quot;11&quot;&gt;&amp;nbsp;[11]&lt;/sup&gt;&lt;a name=&quot;ref_[11]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2012年起，他相继主演了历史片《&lt;a data-lemmaid=&quot;6285026&quot; href=&quot;https://baike.baidu.com/item/%E7%8E%8B%E7%9A%84%E7%9B%9B%E5%AE%B4/6285026&quot; target=&quot;_blank&quot;&gt;王的盛宴&lt;/a&gt;》、悬疑片《&lt;a data-lemmaid=&quot;10102496&quot; href=&quot;https://baike.baidu.com/item/%E6%8E%A7%E5%88%B6/10102496&quot; target=&quot;_blank&quot;&gt;控制&lt;/a&gt;》、爱情片《&lt;a data-lemmaid=&quot;35516&quot; href=&quot;https://baike.baidu.com/item/%E5%8D%95%E8%BA%AB%E7%94%B7%E5%A5%B3/35516&quot; target=&quot;_blank&quot;&gt;单身男女&lt;/a&gt;》系列&lt;sup data-ctrmap=&quot;:12,:13,&quot; data-sup=&quot;12-13&quot;&gt;&amp;nbsp;[12-13]&lt;/sup&gt;&lt;a name=&quot;ref_[12-13]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2014年，主演犯罪片《&lt;a data-lemmaid=&quot;10702658&quot; href=&quot;https://baike.baidu.com/item/%E9%AD%94%E8%AD%A6/10702658&quot; target=&quot;_blank&quot;&gt;魔警&lt;/a&gt;》&lt;sup data-ctrmap=&quot;:14,&quot; data-sup=&quot;14&quot;&gt;&amp;nbsp;[14]&lt;/sup&gt;&lt;a name=&quot;ref_[14]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;；同年，主演个人首部美剧《&lt;a data-lemmaid=&quot;16414154&quot; href=&quot;https://baike.baidu.com/item/%E8%8D%92%E5%8E%9F/16414154&quot; target=&quot;_blank&quot;&gt;荒原&lt;/a&gt;》系列&lt;sup data-ctrmap=&quot;:15,:16,&quot; data-sup=&quot;15-16&quot;&gt;&amp;nbsp;[15-16]&lt;/sup&gt;&lt;a name=&quot;ref_[15-16]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2015年，其主演的励志片《&lt;a data-lemmaid=&quot;16848662&quot; href=&quot;https://baike.baidu.com/item/%E6%BB%9A%E8%9B%8B%E5%90%A7%EF%BC%81%E8%82%BF%E7%98%A4%E5%90%9B/16848662&quot; target=&quot;_blank&quot;&gt;滚蛋吧！肿瘤君&lt;/a&gt;》取得5.1亿的票房成绩&lt;sup data-ctrmap=&quot;:17,&quot; data-sup=&quot;17&quot;&gt;&amp;nbsp;[17]&lt;/sup&gt;&lt;a name=&quot;ref_[17]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2016年，其主演的魔幻片《&lt;a data-lemmaid=&quot;18611591&quot; href=&quot;https://baike.baidu.com/item/%E9%AD%94%E5%85%BD/18611591&quot; target=&quot;_blank&quot;&gt;魔兽&lt;/a&gt;》在全球上映&lt;sup data-ctrmap=&quot;:18,&quot; data-sup=&quot;18&quot;&gt;&amp;nbsp;[18]&lt;/sup&gt;&lt;a name=&quot;ref_[18]_5880&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。&lt;/p&gt;\n','https://baike.baidu.com/item/吴彦祖','2019-03-07 03:16:09',NULL),(6,'张学友','/public/upload/wechat/2019/03-05/dd6ed3a74f0f802747916428253dbe7f.jpeg',1,'sam','张学友（Jacky Cheung），1961年7月10日出生于香港，中国香港男歌手、演员，毕业于香港崇文英文书院。\n\n1984年因获得首届香港十八区业余歌唱大赛冠军而出道。1985年发行个人首张专辑《Smile》。1993年发行的专辑《吻别','&lt;p&gt;张学友（Jacky Cheung），1961年7月10日出生于香港，中国香港男歌手、演员，毕业于香港崇文英文书院。&lt;/p&gt;\n\n&lt;p&gt;1984年因获得首届香港十八区业余歌唱大赛冠军而出道。1985年发行个人首张专辑《&lt;a data-lemmaid=&quot;10216590&quot; href=&quot;https://baike.baidu.com/item/Smile/10216590&quot; target=&quot;_blank&quot;&gt;Smile&lt;/a&gt;》。1993年发行的专辑《&lt;a data-lemmaid=&quot;14937710&quot; href=&quot;https://baike.baidu.com/item/%E5%90%BB%E5%88%AB/14937710&quot; target=&quot;_blank&quot;&gt;吻别&lt;/a&gt;》打破华语唱片在台湾的销量纪录&lt;sup data-ctrmap=&quot;:1,&quot; data-sup=&quot;1&quot;&gt;&amp;nbsp;[1]&lt;/sup&gt;&lt;a name=&quot;ref_[1]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。1995年起连续两年获得&lt;a data-lemmaid=&quot;6690633&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%96%E7%95%8C%E9%9F%B3%E4%B9%90%E5%A4%A7%E5%A5%96/6690633&quot; target=&quot;_blank&quot;&gt;世界音乐大奖&lt;/a&gt;全球销量最高华人歌手奖&lt;sup data-ctrmap=&quot;:2,:3,&quot; data-sup=&quot;2-3&quot;&gt;&amp;nbsp;[2-3]&lt;/sup&gt;&lt;a name=&quot;ref_[2-3]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。1997年参与策划的音乐剧《&lt;a data-lemmaid=&quot;69095&quot; href=&quot;https://baike.baidu.com/item/%E9%9B%AA%E7%8B%BC%E6%B9%96/69095&quot; target=&quot;_blank&quot;&gt;雪狼湖&lt;/a&gt;》在香港连续演出42场。1998年获得第9届&lt;a data-lemmaid=&quot;4113339&quot; href=&quot;https://baike.baidu.com/item/%E5%8F%B0%E6%B9%BE%E9%87%91%E6%9B%B2%E5%A5%96/4113339&quot; target=&quot;_blank&quot;&gt;台湾金曲奖&lt;/a&gt;最佳国语男演唱人奖&lt;sup data-ctrmap=&quot;:4,&quot; data-sup=&quot;4&quot;&gt;&amp;nbsp;[4]&lt;/sup&gt;&lt;a name=&quot;ref_[4]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2001年获得第23届&lt;a href=&quot;https://baike.baidu.com/item/%E5%8D%81%E5%A4%A7%E4%B8%AD%E6%96%87%E9%87%91%E6%9B%B2&quot; target=&quot;_blank&quot;&gt;十大中文金曲&lt;/a&gt;&lt;a data-lemmaid=&quot;4407048&quot; href=&quot;https://baike.baidu.com/item/%E9%87%91%E9%92%88%E5%A5%96/4407048&quot; target=&quot;_blank&quot;&gt;金针奖&lt;/a&gt;&lt;sup data-ctrmap=&quot;:5,&quot; data-sup=&quot;5&quot;&gt;&amp;nbsp;[5]&lt;/sup&gt;&lt;a name=&quot;ref_[5]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2004年发行首张个人全创作专辑《&lt;a href=&quot;https://baike.baidu.com/item/Life%20Is%20Like%20A%20Dream&quot; target=&quot;_blank&quot;&gt;Life Is Like A Dream&lt;/a&gt;》。2010年12月30日至2011年12月29日，举办&amp;ldquo;&lt;a href=&quot;https://baike.baidu.com/item/%E5%BC%A0%E5%AD%A6%E5%8F%8B1%2F2%E4%B8%96%E7%BA%AA%E4%B8%96%E7%95%8C%E5%B7%A1%E5%9B%9E%E6%BC%94%E5%94%B1%E4%BC%9A&quot; target=&quot;_blank&quot;&gt;张学友1/2世纪世界巡回演唱会&lt;/a&gt;&amp;rdquo;，打破12个月内巡演观众人数的&lt;a data-lemmaid=&quot;1069992&quot; href=&quot;https://baike.baidu.com/item/%E5%90%89%E5%B0%BC%E6%96%AF%E4%B8%96%E7%95%8C%E7%BA%AA%E5%BD%95/1069992&quot; target=&quot;_blank&quot;&gt;吉尼斯世界纪录&lt;/a&gt;&lt;sup data-ctrmap=&quot;:6,&quot; data-sup=&quot;6&quot;&gt;&amp;nbsp;[6]&lt;/sup&gt;&lt;a name=&quot;ref_[6]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2013年获得&lt;a data-lemmaid=&quot;492301&quot; href=&quot;https://baike.baidu.com/item/%E7%AC%AC35%E5%B1%8A%E5%8D%81%E5%A4%A7%E4%B8%AD%E6%96%87%E9%87%91%E6%9B%B2/492301&quot; target=&quot;_blank&quot;&gt;第35届十大中文金曲&lt;/a&gt;金曲35周年荣誉大奖&lt;sup data-ctrmap=&quot;:7,&quot; data-sup=&quot;7&quot;&gt;&amp;nbsp;[7]&lt;/sup&gt;&lt;a name=&quot;ref_[7]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2016年举行&amp;ldquo;A CLASSIC TOUR 学友&amp;middot;经典世界巡回演唱会&amp;rdquo;&lt;sup data-ctrmap=&quot;:8,&quot; data-sup=&quot;8&quot;&gt;&amp;nbsp;[8]&lt;/sup&gt;&lt;a name=&quot;ref_[8]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。&lt;/p&gt;\n\n&lt;p&gt;1986年出演个人首部电影《&lt;a data-lemmaid=&quot;2927043&quot; href=&quot;https://baike.baidu.com/item/%E9%9C%B9%E9%9B%B3%E5%A4%A7%E5%96%87%E5%8F%AD/2927043&quot; target=&quot;_blank&quot;&gt;霹雳大喇叭&lt;/a&gt;》。1989年凭借剧情片《&lt;a data-lemmaid=&quot;27681&quot; href=&quot;https://baike.baidu.com/item/%E6%97%BA%E8%A7%92%E5%8D%A1%E9%97%A8/27681&quot; target=&quot;_blank&quot;&gt;旺角卡门&lt;/a&gt;》获得第8届&lt;a href=&quot;https://baike.baidu.com/item/%E9%A6%99%E6%B8%AF%E7%94%B5%E5%BD%B1%E9%87%91%E5%83%8F%E5%A5%96&quot; target=&quot;_blank&quot;&gt;香港电影金像奖&lt;/a&gt;最佳男配角奖&lt;sup data-ctrmap=&quot;:9,&quot; data-sup=&quot;9&quot;&gt;&amp;nbsp;[9]&lt;/sup&gt;&lt;a name=&quot;ref_[9]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。1990年凭借武侠片《&lt;a data-lemmaid=&quot;8469351&quot; href=&quot;https://baike.baidu.com/item/%E7%AC%91%E5%82%B2%E6%B1%9F%E6%B9%96/8469351&quot; target=&quot;_blank&quot;&gt;笑傲江湖&lt;/a&gt;》获得第27届&lt;a href=&quot;https://baike.baidu.com/item/%E5%8F%B0%E6%B9%BE%E7%94%B5%E5%BD%B1%E9%87%91%E9%A9%AC%E5%A5%96&quot; target=&quot;_blank&quot;&gt;台湾电影金马奖&lt;/a&gt;最佳男配角奖&lt;sup data-ctrmap=&quot;:10,&quot; data-sup=&quot;10&quot;&gt;&amp;nbsp;[10]&lt;/sup&gt;&lt;a name=&quot;ref_[10]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。1993年出演喜剧片《&lt;a data-lemmaid=&quot;26041&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%9C%E6%88%90%E8%A5%BF%E5%B0%B1/26041&quot; target=&quot;_blank&quot;&gt;东成西就&lt;/a&gt;》。1996年正式息影。2001年复出拍片。2002年凭借文艺片《&lt;a data-lemmaid=&quot;17425&quot; href=&quot;https://baike.baidu.com/item/%E7%94%B7%E4%BA%BA%E5%9B%9B%E5%8D%81/17425&quot; target=&quot;_blank&quot;&gt;男人四十&lt;/a&gt;》获得印度新德里电影节最佳男演员奖&lt;sup data-ctrmap=&quot;:11,&quot; data-sup=&quot;11&quot;&gt;&amp;nbsp;[11]&lt;/sup&gt;&lt;a name=&quot;ref_[11]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。2007年在&lt;a data-lemmaid=&quot;3556325&quot; href=&quot;https://baike.baidu.com/item/%E9%A6%99%E6%B8%AF%E6%98%9F%E5%85%89%E5%A4%A7%E9%81%93/3556325&quot; target=&quot;_blank&quot;&gt;香港星光大道&lt;/a&gt;留下手印。2010年主演文艺片《&lt;a data-lemmaid=&quot;1132000&quot; href=&quot;https://baike.baidu.com/item/%E6%9C%88%E6%BB%A1%E8%BD%A9%E5%B0%BC%E8%AF%97/1132000&quot; target=&quot;_blank&quot;&gt;月满轩尼诗&lt;/a&gt;》。2015年主演动作片《&lt;a data-lemmaid=&quot;16856390&quot; href=&quot;https://baike.baidu.com/item/%E8%B5%A4%E9%81%93/16856390&quot; target=&quot;_blank&quot;&gt;赤道&lt;/a&gt;》&lt;sup data-ctrmap=&quot;:12,&quot; data-sup=&quot;12&quot;&gt;&amp;nbsp;[12]&lt;/sup&gt;&lt;a name=&quot;ref_[12]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。&lt;/p&gt;\n\n&lt;p&gt;张学友热心公益慈善。1998年当选香港十大杰出青年。&lt;sup data-ctrmap=&quot;:13,&quot; data-sup=&quot;13&quot;&gt;&amp;nbsp;[13]&lt;/sup&gt;&lt;a name=&quot;ref_[13]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;1999年当选世界十大杰出青年。&lt;sup data-ctrmap=&quot;:14,&quot; data-sup=&quot;14&quot;&gt;&amp;nbsp;[14]&lt;/sup&gt;&lt;a name=&quot;ref_[14]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;2003年至2009年担任香港演艺人协会副会长&lt;sup data-ctrmap=&quot;:15,&quot; data-sup=&quot;15&quot;&gt;&amp;nbsp;[15]&lt;/sup&gt;&lt;a name=&quot;ref_[15]_3390&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。&lt;/p&gt;\n','https://baike.baidu.com/item/%E5%BC%A0%E5%AD%A6%E5%8F%8B','2019-03-07 03:16:09',NULL),(7,'迪丽热巴','/public/upload/wechat/2019/03-05/97477198c7e80aa5b853b2b3cb8df2c0.jpg',1,'sam','迪丽热巴（Dilraba），1992年6月3日出生于新疆乌鲁木齐市，中国内地影视女演员，毕业于上海戏剧学院。\n\n2013年，迪丽热巴因主演个人首部电视剧《阿娜尔罕》而出道&amp;amp;nbsp;[1]&amp;amp;nbsp;&amp;amp;nbsp;。2014年，她主演了奇幻剧','&lt;p&gt;迪丽热巴（Dilraba），1992年6月3日出生于新疆乌鲁木齐市，中国内地影视女演员，毕业于上海戏剧学院。&lt;/p&gt;&lt;p&gt;2013年，迪丽热巴因主演个人首部电视剧《&lt;a href=&quot;https://baike.baidu.com/item/%E9%98%BF%E5%A8%9C%E5%B0%94%E7%BD%95/10988554&quot; target=&quot;_blank&quot;&gt;阿娜尔罕&lt;/a&gt;》而出道&lt;sup&gt;&amp;nbsp;[1]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;。2014年，她主演了奇幻剧《&lt;a href=&quot;https://baike.baidu.com/item/%E9%80%86%E5%85%89%E4%B9%8B%E6%81%8B/15443810&quot; target=&quot;_blank&quot;&gt;逆光之恋&lt;/a&gt;》&lt;sup&gt;&amp;nbsp;[2]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;。2015年，迪丽热巴凭借爱情剧《&lt;a href=&quot;https://baike.baidu.com/item/%E5%85%8B%E6%8B%89%E6%81%8B%E4%BA%BA/15949407&quot; target=&quot;_blank&quot;&gt;克拉恋人&lt;/a&gt;》赢得高人气，并获得国剧盛典最受欢迎新人女演员奖&lt;sup&gt;&amp;nbsp;[3]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;。2016年，其主演的现代剧《&lt;a href=&quot;https://baike.baidu.com/item/%E9%BA%BB%E8%BE%A3%E5%8F%98%E5%BD%A2%E8%AE%A1/16742684&quot; target=&quot;_blank&quot;&gt;麻辣变形计&lt;/a&gt;》播出&lt;sup&gt;&amp;nbsp;[4]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;；同年，迪丽热巴还凭借喜剧片《&lt;a href=&quot;https://baike.baidu.com/item/%E5%82%B2%E5%A8%87%E4%B8%8E%E5%81%8F%E8%A7%81/17604843&quot; target=&quot;_blank&quot;&gt;傲娇与偏见&lt;/a&gt;》获得中英电影节最佳新人奖&lt;sup&gt;&amp;nbsp;[5]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;。2017年，她凭借玄幻剧《&lt;a href=&quot;https://baike.baidu.com/item/%E4%B8%89%E7%94%9F%E4%B8%89%E4%B8%96%E5%8D%81%E9%87%8C%E6%A1%83%E8%8A%B1/16246274&quot; target=&quot;_blank&quot;&gt;三生三世十里桃花&lt;/a&gt;》获得白玉兰奖最佳女配角提名&lt;sup&gt;&amp;nbsp;[6]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;。2018年，迪丽热巴成为了金鹰电视艺术节的第七位&amp;amp;ldquo;金鹰女神&amp;amp;rdquo;&lt;sup&gt;&amp;nbsp;[7]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;，并获得了第29届中国电视金鹰奖观众喜爱的女演员、第12届中国金鹰电视艺术节最具人气女演员两项殊荣&lt;sup&gt;&amp;nbsp;[8]&lt;/sup&gt;&lt;img class=&quot;anchorclass&quot;/&gt;&amp;nbsp;&amp;nbsp;&lt;/p&gt;','','2019-03-07 07:36:27',NULL),(8,'测试','/public/upload/wechat/2019/03-05/94191ab59eee3cc866d7305f804b3dcb.jpg',1,'','1233444444444444444444444','&lt;p&gt;1233444444444444444444444&lt;img src=&quot;/public/upload/wechat/2019/03-07/2e5c6edbdb7ddc872a0cb8b4e4b063fc.png&quot; title=&quot;&quot; alt=&quot;&quot;/&gt;&lt;/p&gt;','','2019-03-07 07:37:22',NULL);
